(1, '<h1 dir=\"ltr\" style=\"line-height: 1.295; text-align: center; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 20pt; font-family: \'Times New Roman\'; color: #000080; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">DOC N&deg;2</span></h1>\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 8pt;\"><span style=\"font-size: 20pt; font-family: \'Times New Roman\'; color: #000080; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">R&eacute;sum&eacute; de la prise de connaissance g&eacute;n&eacute;rale du client</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-left: 18pt; margin-top: 0pt; margin-bottom: 8pt;\"><span style=\"font-size: 20pt; font-family: \'Times New Roman\'; color: #000080; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: underline; -webkit-text-decoration-skip: none; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">Points d&rsquo;orientations </span><span style=\"font-size: 20pt; font-family: \'Times New Roman\'; color: #000080; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;</span></p>\r\n<ul style=\"margin-top: 0; margin-bottom: 0; padding-inline-start: 48px;\">\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Identifier le client (Cf. fiche d&rsquo;identification du client Doc n&deg;8).</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Identifier la liste des &eacute;tablissements, agences, annexes, filiales et soci&eacute;t&eacute; m&egrave;re du client.</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">D&eacute;crire l&rsquo;organisation g&eacute;n&eacute;rale et administrative du client notamment les principaux organes et leurs r&ocirc;les dans la gestion de la soci&eacute;t&eacute;,</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">D&eacute;crire avec pr&eacute;cision les activit&eacute;s, les diff&eacute;rents produits et services offerts &agrave; la client&egrave;le, un r&eacute;sum&eacute; ou un sch&eacute;ma technique du processus de production et de services.</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Etablir la liste des principaux fournisseurs et clients ainsi que leur localisation g&eacute;ographique (pays, ville, etc.), y compris les modalit&eacute;s et modes de paiements desdits fournisseurs et clients.</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Mentionner les modes de paiement (banques, caisse) et leurs modalit&eacute;s.</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Etablir la liste des banques du client et des signataires.</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">D&eacute;crire les caract&eacute;ristiques d&rsquo;exploitation du client avec ses agences, ses annexes, ses filiales ou sa soci&eacute;t&eacute; m&egrave;re, etc.</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Collecter les imprim&eacute;s de caract&egrave;re g&eacute;n&eacute;ral (papier en-t&ecirc;te, prospectus, documents publicitaires, les tarifs de ses produits et services).</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">N&eacute;cessit&eacute; de tenir une comptabilit&eacute; particuli&egrave;re dite </span><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&laquo;&nbsp;Op&eacute;rations Comptables&nbsp;Sp&eacute;cifiques,&nbsp; OPS&raquo;</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Autres informations utiles sur le client,</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: disc; font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 8pt;\" role=\"presentation\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Risques ou Difficult&eacute;s comptables qu&rsquo;engendrent les proc&eacute;dures et transactions du Client. A ce niveau, le chef de mission doit remplir la </span><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&laquo;&nbsp;fiche de d&eacute;termination du niveau des risques&nbsp;&raquo; (Cf. Doc n&deg;9)</span><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; 