xt-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 20pt; font-family: \'Times New Roman\'; color: #000080; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Sp&eacute;cificit&eacute;s de la structure (relation intra groupe et avec les partenaires)&nbsp;</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: upper-roman; font-size: 20pt; font-family: \'Times New Roman\'; color: #000080; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 20pt; font-family: \'Times New Roman\'; color: #000080; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Aspect fiscal et social</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: upper-roman; font-size: 20pt; font-family: \'Times New Roman\'; color: #000080; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 20pt; font-family: \'Times New Roman\'; color: #000080; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Difficult&eacute;s et approches de solutions</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: upper-roman; font-size: 20pt; font-family: \'Times New Roman\'; color: #000080; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 20pt; font-family: \'Times New Roman\'; color: #000080; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Comptabilisation de l&rsquo;activit&eacute;&nbsp;</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: upper-roman; font-size: 20pt; font-family: \'Times New Roman\'; color: #000080; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 8pt;\" role=\"presentation\"><span style=\"font-size: 20pt; font-family: \'Times New Roman\'; color: #000080; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Documents &agrave; fournir</span></p>\r\n</li>\r\n</ol>', 'DOC N°2\r\n\r\nRésumé de la prise de connaissance générale du client\r\n\r\nPoints d’orientations  \r\n\r\nIdentifier le client (Cf. fiche d’identification du client Doc n°8).\r\n\r\nIdentifier la liste des établissements, agences, annexes, filiales et société mère du client.\r\n\r\nDécrire l’organisation générale et administrative du client notamment les principaux organes et leurs rôles dans la gestion de la société,\r\n\r\nDécrire avec précision les activités, les différents produits et services offerts à la clientèle, un résumé ou un schéma technique du processus de production et de services.\r\n\r\nEtablir la liste des principaux fournisseurs et clients ainsi que leur localisation géographique (pays, ville, etc.), y compris les modalités et modes de paiements desdits fournisseurs et clients.\r\n\r\nMentionner les modes de paiement (banques, caisse) et leurs modalités.\r\n\r\nEtablir la liste des banques du client et des signataires.\r\n\r\nDécrire les caractéristiques d’exploitation du client avec ses agences, ses annexes, ses filiales ou sa société mère, etc.\r\n\r\nCollecter les imprimés de caractère général (papier en-tête, prospectus, documents publicitaires, les tarifs de ses produits et services).\r\n\r\nNécessité de tenir une comptabilité particulière dite « Opérations Comptables Spécifiques,  OPS»\r\n\r\nAutres informations utiles sur le client,\r\n\r\nRisques ou Difficultés comptables qu’engendrent les procédures et transactions du Client. A ce niveau, le chef de mission doit remplir la « fiche de détermination du niveau des risques » (Cf. Doc n°9). Ladite fiche sera validée par le Directeur de Département DEC.\r\n\r\n\r\n\r\n\r\nRésumé\r\n\r\nTest de modification pour le compte de l\'application ged 2022\r\n\r\nSoumission check 1.0.1\r\nTest d\'envoi de request check 1.0.2\r\nFinalisation terminer check 1.0.3\r\nNew test for today 1.0.4\r\n\r\nTest by Arnaud - apwebstore\r\n\r\nDate de prise de contact…………………..\r\n\r\nConfiguration juridique de la structure \r\n\r\nPour complément d’informations confère document n°8.\r\n\r\nRaison sociale de l’entité : Emmanuel La Grâce SA\r\n\r\nSigle : Emmanuel La Grâce SA\r\n\r\nAbréviation : ELG SA\r\n\r\nDate de création : 08 Juin 2017\r\n\r\nLieu : Porto-Novo\r\n\r\nDate de début d’exploitation : 13 Juin 2017\r\n\r\nForme juridique : Société Anonyme avec conseil d’administration \r\n\r\nDirection : est dirigée par un Président Directeur Général et un Directeur Général Adjoint\r\n\r\nCapital social : 10 000 000 F CFA\r\n\r\nL’assemblée générale est composée d’un Président et de quatre administrateurs\r\n\r\nNuméro de registre de commerce et du crédit mobilier : n° RCCM RB/COT/17 B 19273 \r\n\r\nNuméro IFU : n°3201710041944\r\n\r\nAdresse : \r\n\r\n\r\n\r\n\r\n\r\nSynthèse de l’activité\r\n\r\nSpécificités de la structure (relation intra groupe et avec les partenaires) \r\n\r\nAspect fiscal et social\r\n\r\nDifficultés et approches de solutions\r\n\r\nComptabilisation de l’activité \r\n\r\nDocuments à fournir', 2);

